import './App.css';
import React, { } from 'react';

function Rainbow({text, refLink, type, width}) {
  return(
    <div className={`isolate ${type}s`} style={{width}}>
      <a href={ref} className={`${type} rainbow blue`}>
        {text}
      </a>

      <a href={ref} className={`${type} rainbow green`}>
        {text}
      </a>

      <a href={ref} className={`${type} rainbow red`}>
        {text}
      </a>
    </div>
  );
}

function Title() {
  return (
    <div className="center">
    <Rainbow
        type={"title"}
        ref = {"index.html"}
        text = {"JackSavini.com"}
      />
    </div>
  );
}

function Taskbar() {
  return (
    <div style={{ width: "80%", marginLeft: "10%" }}>
      <hr style = {{width: "100%"}}></hr>
      <div className="center navBar">
        <Rainbow
          type={"link"}
          ref = {"aboutMe.html"}
          text = {"About Me"}
          width = {"182px"}
        />

        <Rainbow
          type={"link"}
          ref = {"blog.html"}
          text = {"Blog"}
          width = {"85px"}
        />

        <Rainbow
          type={"link"}
          ref = {"arcade.html"}
          text = {"Arcade"}
          width = {"130px"}
        />

        <Rainbow
          type={"link"}
          ref = {"career.html"}
          text = {"Career"}
          width = {"125px"}
        />
      </div>
      <hr style = {{width: "100%"}}></hr>
    </div>
  );
}

function App() {
  return (
    <div>
      <Title/>
      <Taskbar/>
    </div>
  );
}

export default App;
